import React from 'react'

function CreateNew() {

    function handleSubmit(e) {
        e.preventDefault();
        console.log(e.target.input)
    }

    return (
        <form className="add-new" onSubmit={handleSubmit}>
            <input placeholder="Create a new todo..."></input>
            <button type="submit"/>
        </form>
    )
}

export default CreateNew
